import React from 'react';
import { Link } from 'react-router-dom'
import Title from './Title';

const Main = () => {
    return (
        <div>
        <button  className='btn btn-lg btn-info btn-block' type="submit"></button>
        <Link to='/'><button className='btn btn-lg btn-muted btn-block' type="submit"><Title /></button></Link>
        <Link to='/'><button className='btn btn-lg btn-dark btn-block' type="submit">Logout</button></Link>
        </div>
    )
}

export default Main;
